import React from "react";
import ReactDOM from "react-dom";
import { Link, withRouter, NavLink } from "react-router-dom";
import ImageContainer from "./ImageContainer";

class LinksContainer extends React.Component {
  render() {
    let rootComments = this.props.comments.map((c, index) => (
      <div className="flex__row">
        <ImageContainer className="image__container" image={c.site} />
        <Link to={c.linkHref} className="no-underlines">
          {c.linkText}
        </Link>
      </div>
    ));

    return <div className="flex__column">{rootComments}</div>;
  }
}

export default withRouter(LinksContainer);
